import React from 'react';
import { Card, CardContent, CardItem, CardHeader, Button } from '../../atoms';
import { ImagePreview, BasicProfile, BasicInfo, Abilities, StatsList } from '../../molekules';

import "./pokemonCard.css";

const ProfileCard = ({catching,...props}) => {
    const { id, name, owned, types, sprites, height, weight, abilities, stats } = props;
    return (
        <div className="profile-container">
            <Card border withMargin center>
                <ImagePreview sprites={sprites} />
                <BasicProfile name={name}
                    owned={owned}
                    types={types}/>
                <CardItem center>
                    <Button className="btn" onClick={() => catching({ id: id, name: name })}>Catch Pokemon</Button>
                </CardItem>
            </Card>
            <Card border withMargin wrap fullItem>
                <CardHeader top>Details</CardHeader>
                <CardContent row>
                    <BasicInfo height={height} weight={weight} />
                    <Abilities abilities={abilities} />
                </CardContent>
                <CardHeader>Stats</CardHeader>
                <StatsList stats={stats} />
            </Card>
        </div>
    )
}

export default ProfileCard;
